          <Route path="/problemslist" element={<ProblemsPage />} />
          <Route path="/problems/add-problem" element={<AddProblemPage />} />
          <Route path="/problems/:problemId" element={<CompilerPage />} />
          <Route path="profile/:userId" element={<ProfilePage/>} /> */}
        </Routes>
      </UserProvider>

      {/* <ProfilePage/> */}
      <ProblemsPage />
    </div>
  );
}

export default App;
